  componentDidMount() {
    fetch("/api/test")
      .then(res => res.text()).then(test => {
        console.log(test);
      })
  }
  render() {
    return (
      <div className="App">
        <BrowserRouter>
        <Header></Header>
          <RouteShortHand path="/forsale" comp={<ForSale/>}/>
          <RouteShortHand path="/ren" comp={<ForSale/>}/>
          <RouteShortHand path="/forsale" comp={<ForSale/>}/>
          <RouteShortHand path="/forsale" comp={<ForSale/>}/>
          <Route exact path="/rent">
            <Rent></Rent>
          </Route>
          <Route exact path="/roommates">
            <Roommates></Roommates>
          </Route>
          <Route exact path="/commercial">
            <Commercial></Commercial>
          </Route>
        </BrowserRouter>
      </div>
    );
  }
}



export default App;
